import React from 'react';
import destinationsData from '../destinations.json';
const Home = () => {

  return <div>
      {welcome()}
      {renderDestinations()}


  </div>;
};



const welcome = () =>{
  return <h1 className="text-3xl font-bold mb-6">Top Travel Destinations</h1>
}


const renderCountriesandCities=()=>{

}

const renderDestinations = () => {
  // Separate countries and cities
  const countries = [...new Set(destinationsData.destinations.map(destination => destination.country))];
  const cities = destinationsData.destinations.map(destination => destination.name);

  return (
    <div className="container mx-auto p-4">
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">

        {/* Countries Block */}
        <div className="bg-white rounded-lg shadow-lg overflow-hidden">
          <div className="p-4">
            <h2 className="text-xl font-bold mb-4">Countries</h2>
            <ul className="list-disc list-inside">
              {countries.map((country, index) => (
                <li key={index} className="text-gray-700">{country}</li>
              ))}
            </ul>
          </div>
        </div>

        {/* Cities Block */}
        <div className="bg-white rounded-lg shadow-lg overflow-hidden">
          <div className="p-4">
            <h2 className="text-xl font-bold mb-4">Cities</h2>
            <ul className="list-disc list-inside">
              {cities.map((city, index) => (
                <li key={index} className="text-gray-700">{city}</li>
              ))}
            </ul>
          </div>
        </div>

      </div>
    </div>
  );
};


